import { NgModule } from '@angular/core';
import { BrowserModule } from '@angular/platform-browser';

import { AppComponent } from './app.component';
import { EventsComponent } from './events/events.component';
import { EventDetailPageComponentComponent } from './events/event-page/event-detail-page-component/event-detail-page-component.component';
import { EventPageComponentComponent } from './events/event-page/event-page-component/event-page-component.component';

@NgModule({
  declarations: [
    AppComponent,
    EventsComponent,
    EventDetailPageComponentComponent,
    EventPageComponentComponent
  ],
  imports: [
    BrowserModule
  ],
  providers: [],
  bootstrap: [AppComponent]
})
export class AppModule { }
